import React from 'react';
import { Button, Text, View } from 'react-native';

const Details = () => {
    return(
        <View style={{flex:1,justifyContent:'center', alignContent:'center'}}> 
            <Text>
                Hello View
            </Text>
        </View>
    );
};

export default Details;
